  box-sizing: border-box;
  margin: 0 auto;
  padding: 0 1rem;
  position: relative;
  z-index: 2;
}
@media only screen and (min-width: 880px) {
  .page {
    width: 880px;
    padding: 0;
  }
}
address,
article,
aside,
audio,
body,
blockquote,
canvas,
cite,
dd,
details,
dl,
figcaption,
figure,
footer,
form,
h1,
h2,
h3,
h4,
h5,
h6,
header,
main,
menu,
nav,
ol,
output,
p,
pre,
